		var canvas = document.getElementById('DetailedView');

		var fDetailedOffset = Frames[0].framestart;
		var fDetailedRange = Frames[0].frameend - fDetailedOffset;
		var nWidth = canvas.width;
		var nHeight = canvas.height;
		var nOffsetY = 0;
		var MouseButtonState = [0,0,0,0,0,0,0,0];
		var MouseDrag = 0;
		var MouseZoom = 0;
		var MouseX = 0;
		var MouseY = 0;
		var nModDown = 0;
		var g_MSG = 'no';
		var nDrawCount = 0;

		function DrawDetailed(x, y, dbg)
		{
			var start = new Date();
			nDrawCount++;

			var canvas = document.getElementById('DetailedView');
			var context = canvas.getContext('2d');
			context.clearRect(0, 0, canvas.width, canvas.height);

			var colors = [ '#ff0000', '#ff00ff', '#ffff00'];

			var fScaleX = canvas.width / fDetailedRange; 
			var fOffsetY = -nOffsetY;

			var nNumLogs = Frames[0].ts.length;
			for(nLog = 0; nLog < nNumLogs; nLog++)
			{
				context.fillStyle = 'black';
				context.font = '8pt courier new';
				context.fillText(ThreadNames[nLog], 0, fOffsetY);
				fOffsetY += 10;

				var MaxDepth = 1;
				var StackPos = 0;
				var Stack = Array(20);

				for(i = 0; i < Frames.length; i++)
				{
					var frfr = Frames[i];
					if(frfr.frameend < fDetailedOffset || frfr.framestart > fDetailedOffset + fDetailedRange)
					{
						continue;
					}
					var ts = frfr.ts[nLog];
					var ti = frfr.ti[nLog];
					var tt = frfr.tt[nLog];
					var count = ts.length;

					for(j = 0; j < count; j++)
					{
						var type = tt[j];
						var index = ti[j];
						var time = ts[j];
						if(type == 2)
						{
							//push
							Stack[StackPos] = time;
							StackPos++;
							if(StackPos > MaxDepth)
							{
								MaxDepth = StackPos;
							}
						}
						else if(type == 0)
						{
							if(StackPos>0)
							{
								StackPos--;
								var timestart = Stack[StackPos];
								var timeend = time;
								var X = (timestart - fDetailedOffset) * fScaleX;
								var Y = fOffsetY + StackPos * 10;
								var W = (timeend-timestart)*fScaleX;
								context.fillStyle = TimerInfo[index].color;
								context.fillRect(X, Y, W, 9);
								var name = TimerInfo[index].name;
								var len = TimerInfo[index].len;
								var sublen = Math.floor(W/7);
								if(sublen >= 2)
								{
									if(sublen < len)
										name = name.substr(0, sublen);
									context.fillStyle = 'black';
									context.fillText(name, Math.floor(X+1), Math.floor(Y+7));
									context.fillStyle = 'white';
									context.fillText(name, Math.floor(X), Math.floor(Y+8));
								}


							}
						}
					}
				}
				fOffsetY += (1+MaxDepth) * 10;
			}

			var end = new Date();
			var time = end - start;
			var timeTaken = 'TIME ' + time + 'ms ' + x + ':' + y;
			context.fillStyle = 'black';
			context.font = 'italic 40pt Calibri';
			context.fillText(timeTaken+" " + nDrawCount + "..." + dbg, 100, 100);
		}
		function MicroProfileMoveGraph(X, Y)
		{
			if(X)
			{
				fDetailedOffset += -X * fDetailedRange / nWidth;
			}
			nOffsetY -= Y;
			if(nOffsetY < 0)
			{
				nOffsetY = 0;
			}
		}
		function MicroProfileZoomGraph(nZoom)
		{
			var fOldRange = fDetailedRange;
			if(nZoom>0)
			{
				fDetailedRange *= Math.pow(nModDown ? 1.40 : 1.03, nZoom);
			}
			else
			{
				var fNewDetailedRange = fDetailedRange / Math.pow((nModDown ? 1.40 : 1.03), -nZoom);
				if(fNewDetailedRange < 0.0001) //100ns
					fNewDetailedRange = 0.0001;
				fDetailedRange = fNewDetailedRange;
			}

			var fDiff = fOldRange - fDetailedRange;
			var fMousePrc = MouseX / nWidth;
			if(fMousePrc<0)
			{
				fMousePrc = 0;
			}
			fDetailedOffset += fDiff * fMousePrc;

		}

		function ResizeCanvas() {
            nWidth = canvas.width = window.innerWidth;
            DrawDetailed(0,0);
    	}

    	function MouseMove(evt)
    	{
			var rect = canvas.getBoundingClientRect();
			var x = evt.clientX - rect.left;
			var y = evt.clientY - rect.top;
			if(MouseDrag)
			{
				MicroProfileMoveGraph(x - MouseX, y - MouseY);
			}
			if(MouseZoom)
			{
				if(y != MouseY)
				{
					MicroProfileZoomGraph(y - MouseY);
				}
			}
			MouseX = x;
			MouseY = y;

	        DrawDetailed(x, y, "mousemove");

    	}
    	function MouseButton(bPressed, evt)
    	{
			var rect = canvas.getBoundingClientRect();
			var x = evt.clientX - rect.left;
			var y = evt.clientY - rect.top;
	        //DrawDetailed(x, y, "MouseButton");

    		if(bPressed)
    		{
    			MouseButtonState[evt.button]=1;
    			if(evt.button == 0)
    			{
    				MouseDrag = 1;
    				// MouseX = x;
    				// MouseY = y;
    			}
    		}
    		else
    		{
    			MouseButtonState[evt.button]=1;
    			if(evt.button == 0)
    			{
    				MouseDrag = 0;
    			}
    		}
    	}
    	function MouseOut(evt)
    	{
    		MouseZoom = 0;
    		MouseDrag = 0;
    	}

    	function KeyUp(evt)
    	{
    		if(evt.keyCode == 17)
    		{
    			MouseZoom = 0;
    		}
    	}

    	function KeyDown(evt)
    	{
//    			g_MSG = 'ALALAL' + evt.keyCode;
    		if(evt.keyCode == 17)
    		{
    			MouseDrag = 0;
    			MouseZoom = 1;
    		}
    	}

		canvas.addEventListener('mousemove', MouseMove, false);
		canvas.addEventListener('mousedown', function(evt) { MouseButton(true, evt); });
		canvas.addEventListener('mouseup', function(evt) { MouseButton(false, evt); } );
		//canvas.addEventListener('mouseout', MouseOut);
		window.addEventListener('keydown', KeyDown);
		window.addEventListener('keyup', KeyUp);
		window.addEventListener('resize', ResizeCanvas, false);
